import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Route, Link, Router } from 'react-router-dom';
import Sidebar from './moviesidebar';
import CardMovies from './cardmov';

import NavDashbord from './navdashbord';
import AddForm from './formadd';
import Switch from 'react-bootstrap/esm/Switch';

function Admin() {
  return (

      <div className="App">
        <NavDashbord/>

          <Route exact  path="/ftage/dashboard">  <Sidebar/> </Route>
          <Route exact  path="/ftage/dashboard/add">  <AddForm/> </Route>



      </div>

  );
}

export default Admin;
